description:
Julia thought her marriage was as strong as ever - until one night her husband, Carl, tells her that he's fantasized about her having sex with another man. Afraid that this might be a sign of bigger problems, Julia confides in her girlfriend, Violet about her fears only to discover that Violet's been hotwifing for years. Fascinated that happily married people can still engage in open sexual relationships, Julia and Carl begin testing their own limits as a couple. They role play a hotwifing scenario at home, Carl seeks advice from a friend who's frequently hired as a bull by other husbands, and Julia even heads out to a bar to practice flirting with other men. Aroused by her power as a sexual force and emotionally ready for a new dimension in their relationship, Julia and Carl set out to turn fantasy into a reality.

